import "./App.css";
import Button from '@mui/material/Button';


function App() {
  return (
    <div className="App">
      <h1 style={{ color: "blue", fontFamily: "Poppins" }}>
        Create An Account
      </h1>

      <h4>Already have an account? Login</h4>
      <Button variant="contained">Hello World</Button>


    </div>
  );
}

export default App;
